(19, 'sitemap', '["PlacesAPI"]', 'global $PlacesAr,$ContainerPlaces, $Response;\n\n$ContainerPlaces=Array();\n$TopLevel=Array();\n$Response=Array();\n\n$PlacesAr=$PlacesAPI;\n\nforeach ($PlacesAPI as $place_id=>$place){\n\n	if (isset($place["meta"]["parent"]) && ( $place["meta"]["parent"] != $place_id)  ) $ContainerPlaces[$place["meta"]["parent"]][]=$place_id;\n	elseif ( $place["meta"]["parent"] === $place_id) $TopLevel[]=$place_id;\n}\n\nfunction get_children($place_id){\n	global $PlacesAr, $ContainerPlaces, $Response;\n	if (isset($ContainerPlaces[$place_id])){\n		$Response[]="parent_open";\n		$Response[]="parent_line_open";\n		$Response[]=$PlacesAr[$place_id];\n		$Response[]="close";\n		$Results=array_map("get_children", $ContainerPlaces[$place_id]);\n		$Response[]="parent_close";\n		return $Results;\n	} else {\n		$Response[]="open";\n		$Response[]=$PlacesAr[$place_id];\n		$Response[]="close";\n		return 0;\n	}\n}\n$Results=array_map("get_children", $TopLevel);\nreturn Array("SequencedPlaces"=> $Response,"TopLevel"=> $TopLevel,"ContainerPlaces"=> $ContainerPlaces, "Places"=> $PlacesAPI);'),
(18, 'SitemapGenerator', '["PlacesAPI"]', '$ContainerPlaces = Array();\n$PlacesByPackage = Array();\n$PlacesByLevel = Array();\n$UniqueLevels = Array();\n$PlacesInOrder = Array();\n\n//global $ContainerPlaces, $PlacesByLevel;\nforeach ($PlacesAPI as $place_id=>$place){\n	$PlacesByPackage[$place[\\"app_GUID\\"]][$place_id]=$place;\n	if (isset($place[\\"parent\\"]) && ( $place[\\"parent\\"] != $place_id)  ) $ContainerPlaces[$place[\\"parent\\"]][$place_id]=$place;\n}\n\n\nforeach ($PlacesAPI as $place_id=>$place){\n\n	if (!isset($PlacesByLevel[$place_id])){ $PlacesByLevel[$place_id]=1;\n\n	foreach ($ContainerPlaces as $container_id=>$container)\n		if ($place_id == $container_id){\n			$PlacesByLevel[$container_id]=	1+$PlacesByLevel[$container_id];\nforeach ($ContainerPlaces[$place_id] as $sub_place_id=>$sub_place){\n\n\n$PlacesByLevel[$sub_place_id]=	2+$PlacesByLevel[$container_id];\n}\n}\n}\n}\n\n\n\n//$previous_place=\\"\\";\nforeach ($PlacesAPI as $place_id=>$place){\n\n	if (!isset($PlacesByLevel[$place_id])) \n$PlacesByLevel[$place_id]=1;\n	\n	foreach ($ContainerPlaces as $container_id=>$container)\n		foreach ($container as $sub_place_id=>$sub_place)\n			if ($place_id == $sub_place_id) $PlacesByLevel[$place_id]=	1+$PlacesByLevel[$container_id];\n\n$previous_place=$place_id;\n}\n\n\n\n\nforeach ($PlacesByLevel as $place_id=>$level){\n	if ($level===1) unset($PlacesByLevel[$place_id]);\n		//elseif ($level==2)  $PlacesByLevel[$place_id] = 0;\n		else \n$PlacesByLevel[$place_id] = $PlacesByLevel[$place_id]-1;\n\n	$PlacesAPI[$place_id][\\"level\\"]=$PlacesByLevel[$place_id];\n	\n	if (!in_array($place_id, $UniqueLevels ) && (($PlacesByLevel[$place_id]!=\\"\\")||($PlacesByLevel[$place_id]===0)) ) \n		$UniqueLevels[$PlacesByLevel[$place_id]][]=$place_id;\n}\n\n\n/*\n$PlacesByLevelUnmixed=Array();\nforeach( $PlacesByLevel as $place_id => $level){\n\n	if (isset($ContainerPlaces[$place_id])) {\n\n	$PlacesByLevelUnmixed[$place_id]=$level;\n\n		foreach( $ContainerPlaces[$place_id] as $contained_id => $contained){\n\n$PlacesByLevelUnmixed[$contained_id]=$PlacesByLevel[$contained_id];\nunset($PlacesByLevel[$contained_id]);\n\n		}\n\n	}else{\n\n$PlacesByLevelUnmixed[$place_id]=$level;\n	\n	}\n}\n*/\n//$PlacesByLevel=$PlacesByLevelUnmixed;\n\n\nsort($UniqueLevels); \n$count=0;\nforeach ($PlacesByLevel as $PlacesByLevel_id=>$level){\n$PlacesByLevelNumbered[$count]=$PlacesAPI[$PlacesByLevel_id];\n\n$PlacesByLevelNumbered[$count][\\"id\\"]=$PlacesByLevel_id;\n$PlacesByLevelNumbered[$count][\\"level\\"]=$level;\n$count++;\n}\n\nforeach ($PlacesByLevelNumbered as $PlaceByLevel_id=>$PlaceByLevel){\n\n  if (!isset($prev_place_id)) $PlacesInOrder[$PlaceByLevel[\\"id\\"]]=\\"open\\";\n	else if (isset($ContainerPlaces[$PlacesInOrder[$prev_place_id]]) && isset($ContainerPlaces[$PlacesInOrder[$prev_place_id]][$PlaceByLevel[\\"id\\"]])) $PlacesInOrder[$PlaceByLevel[\\"id\\"]]=\\"open\\";\n	else if (!isset($ContainerPlaces[$PlacesInOrder[$prev_place_id]][$PlaceByLevel[\\"id\\"]])) $PlacesInOrder[$PlaceByLevel[\\"id\\"]]=\\"child\\";\n\n $prev_place_id=$PlaceByLevel[\\"id\\"];\n	}\n\nunset($prev_place_id);\n///921\n\nforeach ($PlacesByLevelNumbered as $PlaceByLevel_id=>$PlaceByLevel){\n$next_place_id=$PlaceByLevel_id+1;\n  if (!isset($prev_place_id)) $PlacesByLevelNumbered[$PlaceByLevel_id][\\"open\\"]=\\"<ol>\\";\n\n  if ($PlacesByLevelNumbered[$PlaceByLevel_id][\\"level\\"]<$PlacesByLevelNumbered[$next_place_id][\\"level\\"]) $PlacesByLevelNumbered[$PlaceByLevel_id][\\"open\\"]=\\"<ol>\\";\n\n  if ($PlacesByLevelNumbered[$PlaceByLevel_id][\\"level\\"]>$PlacesByLevelNumbered[$next_place_id][\\"level\\"]) {\n$level_diff=$PlacesByLevelNumbered[$PlaceByLevel_id][\\"level\\"]-$PlacesByLevelNumbered[$next_place_id][\\"level\\"];\n$level_ul=\\"\\";\nfor($i=0; $i<$level_diff; $i++) $level_ul .=\\" </ol>\\";\n$PlacesByLevelNumbered[$PlaceByLevel_id][\\"close\\"]=$level_ul;\n\n}\n $prev_place_id=$PlaceByLevel_id;\n\n\n\n\n	}\n\n\n\n\n\n/*\n\n$PlacesByLevelMixed =$PlacesByLevel;\n$unmixed=Array();\n\nforeach ($PlacesByLevelMixed as $place_ar_id => $place_ar){\n//print_r($PlacesByLevelMixed);\n//print_r($unmixed);\n//if (isset($PlacesByLevelMixed[$place_ar_id ])){\n\nif (is_array($ContainerPlaces[$place_ar_id])){\n$temp_unmixed_children=Array();\n$unmixed[$place_ar_id]=array_shift($PlacesByLevelMixed);\nif (isset($ContainerPlaces[$place_ar_id])){\nforeach($ContainerPlaces[$place_ar_id] as $contained_place_id =>$contained_place){\n	foreach($PlacesByLevelMixed as $mixed_id => $mixed_place){\n		if ($contained_place_id == $mixed_id) {\n		$temp_unmixed_children[$mixed_id]=$mixed_place;\n		unset($PlacesByLevelMixed[$mixed_id]);\n			}\n		}\n}\n\nif (is_array($temp_unmixed_children)) foreach($temp_unmixed_children as $temp_id=>$temp_level) $unmixed[$temp_id]=$temp_level;\n}\n}else{\n$unmixed[$place_ar_id]=array_shift($PlacesByLevelMixed);\n}\n}\n\n\n\n*/\n	\n\nforeach ($UniqueLevels as $level_id=>$place_ar )\n	foreach ($place_ar as $parent_id)\n		if (isset($UniqueLevels[$level_id+1]) )\n			foreach ($UniqueLevels[$level_id+1] as $child_id)\n					$PlacesAPI[$child_id][\\"parents\\"][]=$parent_id;\n				\n//\n\nreturn Array(\\"PlacesByLevelUnmixed\\"=> $unmixed, \n\\"Places\\"=>$PlacesAPI,\n\\"ContainerPlaces\\"=>$ContainerPlaces,\n\\"PlacesByPackage\\"=>$PlacesByPackage, \n\\"PlacesByLevelNumbered\\"=>$PlacesByLevelNumbered,\n\\"PlacesByLevel\\"=>$PlacesByLevel,  \n\\"PlacesInOrder\\"=>$PlacesInOrder, \n\\"UniqueLevels\\"=>$UniqueLevels );'),
