(22, 'post_media', '', '$movabl_type="media";\n\n$inputs=Array();\n\n$GUID=$GLOBALS->_POST["GUID"];\n\nif ($GUID != "upload"){\n$posted_inputs=json_decode($GLOBALS->_POST["inputs"]);\n\nforeach ($posted_inputs as $input)\n$inputs[$input]=Array();\n\n$data=Array(\n"mimetype"=>$GLOBALS->_POST["mimetype"],\n"content"=>$GLOBALS->_POST["content"],\n"inputs"=>$inputs\n);\n//print_r($data);\n\nif ($GUID =="new") $GUID = null;\n\n}else{\n$GUID = null;\n$tmp_name=$GLOBALS->_FILES["filecontent"]["tmp_name"];\n$mime_type=$GLOBALS->_FILES["filecontent"]["type"];\n//echo "sdf".$mime_type;\n$file_content=file_get_contents($tmp_name);\n\n//$finfo = new finfo(FILEINFO_MIME);\n//$mime_type_ar= explode(";",$finfo->buffer($file_content) );\n//$mime_type=$mime_type_ar[0];\n\n//$mime_type= $finfo->buffer($file_content) ;\n\n$data=Array(\n"mimetype"=>$mime_type,\n"content"=>$file_content\n);\n\necho $mime_type;\n}\n\n//print_r($data);\n\nif ($GUID!="upload"){\n\nif (isset($GLOBALS->_POST["label"])) $data["meta"]= Array ("label"=>$GLOBALS->_POST["label"]);\ndate_default_timezone_set(''America/New_York'');\n\n$GUID=Movabls::set_movabl($movabl_type,$data, $GUID);\n\nif (isset($GLOBALS->_POST["place_url"])){\n\n\n$movabl_type="place";\n//print_r($GLOBALS);\n\n$data=Array(\n"url"=>utf8_encode($GLOBALS->_POST["place_url"]),\n"media_GUID"=>$GUID\n);\n\nif (isset($GLOBALS->_POST["label"])) $data["meta"]["label"] = $GLOBALS->_POST["label"];\n$data["meta"]["parent"] = "root";\n\n\n\ndate_default_timezone_set(''America/New_York'');\n//echo utf8_encode($GLOBALS->_POST["place_url"]);\n$place_GUID=Movabls::set_movabl($movabl_type,$data);\n\nreturn date("h:i:s A").": ".$GUID." + ".$place_GUID;\n}else{\n\nreturn date("h:i:s A").": ".$GUID;\n}\n\n\n//if(Movabls::set_movabl($movabl_type,$data, $GUID))\n//     return date("h:i:s A");\n\n}\n\n\n'),
(23, 'encode_inputs', '["Movabl"]', '$inputs = Array();\nforeach ($Movabl["inputs"] as $input=>$array) $inputs[]=$input;\n\nreturn json_encode($inputs);'),
(24, 'post_function', '', '$movabl_type="function";\r\n$inputs=Array();\r\n\r\nif (isset($GLOBALS->_POST["inputs"]) ){\r\n$posted_inputs=json_decode($GLOBALS->_POST["inputs"]);\r\n\r\nforeach ($posted_inputs as $input)\r\n$inputs[$input]=Array();\r\n}\r\n$data=Array(\r\n"inputs"=>$inputs,\r\n"content"=>$GLOBALS->_POST["content"]\r\n);\r\n\r\nif (isset($GLOBALS->_POST["label"])) $data["meta"]= Array ("label"=>$GLOBALS->_POST["label"]);\r\n\r\ndate_default_timezone_set(''America/New_York'');\r\n\r\nif ($GLOBALS->_POST["GUID"]!="new") $GUID=$GLOBALS->_POST["GUID"];\r\nelse $GUID = null;\r\n\r\nif(Movabls::set_movabl($movabl_type,$data, $GLOBALS->_POST["GUID"]))\r\n     return date("h:i:s A");\r\nelse return "set_mov returns false";\r\n'),
(48, 'mapinterface', '["Interface_Input"]', 'global $temp_tag_ar, $Sequenced_List, $Known_Parents;\n$Sequenced_List=Array();\n$Known_Parents=Array();\n\nfunction get_children($this_tag){\nglobal $temp_tag_ar, $Sequenced_List, $Known_Parents;\nif (is_array($this_tag)){\n	foreach($this_tag as $tag=>$definition){\n		if (is_array($definition["tags"])){\n\n			$Known_Parents[count($Sequenced_List)]=$tag;\n				$Sequenced_List[]="sub_parent_open";\n				$Sequenced_List[]="open";\n					foreach($definition as $k=>$v)\n						if ($k!="tags") $this_set[$k]=$v;\n					$poll=count($Sequenced_List);\n					$Sequenced_List[$poll]["name"]=$tag;\n					$Sequenced_List[$poll]["poll"]=$poll;\n					$Sequenced_List[$poll]["type"]=(isset($this_set["expression"]))?"expression":$this_set["movabl_type"];\n					$Sequenced_List[$poll]["content"]=(isset($this_set["expression"]))?$this_set["expression"]:$this_set["movabl_GUID"];\n\n				$Sequenced_List[]="close";\n				$Results[$tag]=array_map("get_children", $definition);\n				$Sequenced_List[]="sub_parent_close";\n\n		} else {\n\n			$Known_Parents[count($Sequenced_List)]=$tag;\n			$Sequenced_List[]="sub_parent_open";				\n				$Sequenced_List[]="open";\n				$poll=count($Sequenced_List);			\n				$Sequenced_List[$poll]["name"]=$tag;\n				$Sequenced_List[$poll]["poll"]=$poll;\n				$Sequenced_List[$poll]["type"]=(isset($definition["expression"]))?"expression":$definition["movabl_type"];\n				$Sequenced_List[$poll]["content"]=(isset($definition["expression"]))?$definition["expression"]:$definition["movabl_GUID"];\n\n				$Sequenced_List[]="close";\n			$Sequenced_List[]="sub_parent_close";\n		}\n	}\n}else{\n	return $this_tag;\n}\n\n}\n\nforeach($Interface_Input["content"] as $tag=>$definition){\n	if (is_array($definition["tags"])){\n		$temp_tag_ar=$definition;\n		$Known_Parents[count($Sequenced_List)]=$tag;\n		$Sequenced_List[]="parent_open";\n		foreach($definition as $k=>$v)\n			if ($k!="tags") $this_set[$k]=$v;\n		$Sequenced_List[]="open";\n			$poll=count($Sequenced_List);\n			$Sequenced_List[$poll]["name"]=$tag;\n			$Sequenced_List[$poll]["poll"]=$poll;\n			$Sequenced_List[$poll]["type"]=(isset($this_set["expression"]))?"expression":$this_set["movabl_type"];\n			$Sequenced_List[$poll]["content"]=(isset($this_set["expression"]))?$this_set["expression"]:$this_set["movabl_GUID"];\n\n		$Sequenced_List[]="close";\n		array_map("get_children", $temp_tag_ar);\n		$Sequenced_List[]="parent_close";\n	}else{\n		\n	$Known_Parents[count($Sequenced_List)]=$tag;\n	$Sequenced_List[]="parent_open";\n		$Sequenced_List[]="open";\n			$poll=count($Sequenced_List);			\n			$Sequenced_List[$poll]["name"]=$tag;\n			$Sequenced_List[$poll]["poll"]=$poll;\n			$Sequenced_List[$poll]["type"]=(isset($definition["expression"]))?"expression":$definition["movabl_type"];\n			$Sequenced_List[$poll]["content"]=(isset($definition["expression"]))?$definition["expression"]:$definition["movabl_GUID"];\n\n		$Sequenced_List[]="close";\n	$Sequenced_List[]="parent_close";\n	}\n}\n\n$Known_Parents =json_encode($Known_Parents);\n\nreturn Array("Sequenced_List"=>$Sequenced_List, "Known_Parents"=>$Known_Parents);'),
(47, 'post_interface', '', '$movabl_type="interface";\n//echo stripslashes($GLOBALS->_POST["json"]);\n\n$json_content=json_decode($GLOBALS->_POST["json"],TRUE);\n\n$data=Array(\n"content"=>$json_content\n);\n\nif (isset($GLOBALS->_POST["label"])) $data["meta"]["label"] = $GLOBALS->_POST["label"];\n\n\ndate_default_timezone_set(''America/New_York'');\n//print_r($data);\n//print_r( $GLOBALS->_POST );\nif(Movabls::set_movabl($movabl_type,$data, $GLOBALS->_POST["GUID"]))\n     return date("h:i:s A");\nelse return "sfdd";\n'),
