(52, 'fnc000000014gq7rogw8ybtuqe1igrip', '', '//setcookie("mvs_packages",''movabls_ide,uncat'');\n\n\n$packages=explode(",",$GLOBALS->_COOKIE["mvs_packages"]);\n//echo stripslashes($GLOBALS->_COOKIE["mvs_packages"]);\n\n$uncat=FALSE;\n\n\nforeach($packages as $key=>$package){\n if($package=="uncat"){\n unset($packages[$key]);\n$uncat=TRUE;\n}\n}\n\n\nreturn Array("packages"=>$packages,"uncat"=>$uncat);\n\n\n\n\n\n//$packages= explode(",",$GLOBALS->_COOKIE["mvs_packages"]);\n//print_r($GLOBALS->_COOKIE);\n'),
(67, 'fnc000000014gt2p9sw0ebgqlldoypyi', '["Movabl_Ar"]', '$output=Array();\n\n\nforeach($Movabl_Ar["media"] as $movabl_id=>$movabl_array){\n$output["media"][]= Array( "text" => $movabl_array["label"], "id"=>$movabl_id);\n}\n\nforeach($Movabl_Ar["functions"] as $movabl_id=>$movabl_array){\n$output["functions"][]= Array( "text" => $movabl_array["label"], "id"=>$movabl_id);\n}\n\nforeach($Movabl_Ar["interfaces"] as $movabl_id=>$movabl_array){\n$output["interfaces"][]= Array( "text" => $movabl_array["meta"]["label"], "id"=>$movabl_id);\n}\n\nforeach($Movabl_Ar["places"] as $movabl_id=>$movabl_array){\n$output["places"][]= Array( "text" => $movabl_array["label"], "id"=>$movabl_id);\n}\n\n\n\nreturn Array ("media"=>json_encode($output["media"]), "functions"=>json_encode($output["functions"]), "interfaces"=>json_encode($output["interfaces"]), "places"=>json_encode($output["places"]) );');
